"use strict";(self.webpackChunkauthApp=self.webpackChunkauthApp||[]).push([[450],{5450:e=>{e.exports=JSON.parse('[{"key":"0","label":"Sobre n\xf3s","children":[{"key":"0-0","label":"H\xe1 quanto tempo a empresa est\xe1 funcionando?","data":"/faqs","txt":{"es":"Temos v\xe1rias startups de eCommerce, estamos sempre inovando e nossa equipe \xe9 muito experiente nesse novo mundo do com\xe9rcio. N\xe3o hesite em confiar em nossas m\xe3os para selecionar seus novos sapatos."},"type":"url"},{"key":"0-1","label":"Onde se encontram?","data":"/faqs","txt":{"es":"Nossa empresa est\xe1 registrada na Espanha, mas apenas para fins administrativos. Nosso mercado \xe9 o mundo e n\xe3o acreditamos nas fronteiras como limite ao com\xe9rcio."},"type":"url"}]},{"key":"1","label":"Sobre pre\xe7os","children":[{"key":"1-0","label":"Por que os pre\xe7os t\xe3o baixos?","data":"/faqs","txt":{"es":"<p>Acreditamos e trabalhamos para gerar muitas vendas. Isso nos permite reduzir nossas margens de lucro. Outras empresas optam por triplicar os pre\xe7os de custo. Preferimos criar comunidade. Gra\xe7as ao fato de termos pre\xe7os diretos de f\xe1brica, podemos reduzi-los significativamente em compara\xe7\xe3o com a realidade de outros vendedores</p>"},"type":"url"}]},{"key":"2","label":"Sobre remessas","children":[{"key":"2-0","label":"Como \xe9 o processo de envio?","data":"/faqs","txt":{"es":"<p>1- O pagamento \xe9 feito. <br>2- O pagamento \xe9 processado. <br>3- O pedido \xe9 processado e enviado. (24/48 horas) Em casos muito espec\xedficos esse tempo pode ser um pouco maior, chegando at\xe9 72 horas. <br>4- O pedido chega ao seu endere\xe7o. (O prazo de entrega depende do envio selecionado). Alguns pa\xedses (fora dos EUA, Canad\xe1, Comunidade Europeia) podem ter atrasos espec\xedficos em rela\xe7\xe3o ao seu sistema de correio dom\xe9stico.</p>"},"type":"url"},{"key":"2-1","label":"Que tipos de envios voc\xea faz?","data":"/faqs","txt":{"es":"<p>Trabalhamos com dois tipos de envios:<br> 1- ENVIO EXPRESSO - Este envio tem um custo adicional e demora entre 15 a 20 dias \xfateis a partir do momento em que o pedido foi processado.<br>2- ENVIO GRATUITO * - Este envio s\xf3 est\xe1 dispon\xedvel para compras superiores a 99,99\u20ac<br>* n\xe3o dispon\xedvel para alguns pa\xedses - para mais informa\xe7\xf5es consulte atrav\xe9s do formul\xe1rio de contacto</p>"},"type":"url"},{"key":"2-2","label":"Voc\xea envia dinheiro na entrega?","data":"/faqs","txt":{"es":"<p>Quando se trata de remessas internacionais, \xe9 muito dif\xedcil ter esse tipo de servi\xe7o. Por este motivo decidimos n\xe3o ter esta modalidade</p>"},"type":"url"},{"key":"2-3","label":"O que acontece se eu n\xe3o estiver em casa no dia da entrega?","data":"/faqs","txt":{"es":"<p>Neste caso, o entregador deixar\xe1 um aviso * com o qual voc\xea dever\xe1 se dirigir aos correios juntamente com sua identifica\xe7\xe3o pessoal. De qualquer forma, um membro da fam\xedlia que esteja naquele momento tamb\xe9m pode experiment\xe1-lo. <br> Tenha em mente que n\xe3o podem passar mais de 15 dias da visita do entregador, pois se isso acontecer os correios devolver\xe3o o pacote ao remetente. Caso isso aconte\xe7a, voc\xea ter\xe1 que pagar o frete novamente para que possamos envi\xe1-lo novamente assim que o recebermos. <br> * Pode haver diferen\xe7as no manuseio dependendo do pa\xeds de destino.</p>"},"type":"url"},{"key":"2-4","label":"O que posso fazer se n\xe3o receber a minha encomenda?","data":"/faqs","txt":{"es":"<div><p>Pelo fato de que fazemos envios internacionais, embora n\xe3o seja usual, estes podem eventualmente se perder ou ter algum problema que impe\xe7a sua localiza\xe7\xe3o. Por esse motivo, temos um seguro de reembolso.</p><p>Para solicitar um reembolso, devem ter decorrido 60 dias \xfateis a partir da data de envio e voc\xea deve solicit\xe1-lo por e-mail especificando a refer\xeancia do pedido para nosso e-mail de suporte a reembolsos ola@nowsneakers. com. </p><p>Para solicitar um reembolso, 60 dias \xfateis devem ter decorrido a partir da data de envio e voc\xea deve solicit\xe1-lo por e-mail especificando a refer\xeancia do pedido para nosso e-mail de suporte ola@nowsneakers.com.</p>< p >Uma vez solicitado o reembolso do pedido, nossa equipe avaliar\xe1 seu caso e comunicar\xe1 uma resolu\xe7\xe3o em at\xe9 72 horas. Caso sua solicita\xe7\xe3o seja aprovada, o valor total ser\xe1 reembolsado, se poss\xedvel pela mesma forma de pagamento que efetuou a compra</p></div>"},"type":"url"}]},{"key":"3","label":"Sobre pagamentos","children":[{"key":"3-0","label":"Que m\xe9todos de pagamento est\xe3o dispon\xedveis?","data":"/faqs","txt":{"es":"<div><p>Os pagamentos atualmente dispon\xedveis podem ser vistos <a href=\'/way-to-pay\'>aqui</a>.</p></div>"},"type":"url"},{"key":"3-1","label":"\xbfSeguridad SSL?","data":"/faqs","txt":{"es":"<div><p>Um certificado Secure Sockets Layer (SSL) \xe9 um certificado digital que autentica a identidade de um site e criptografa as informa\xe7\xf5es enviadas ao servidor usando a tecnologia SSL. Um certificado serve como um \'passaporte\' eletr\xf4nico que estabelece as credenciais de uma entidade on-line ao fazer neg\xf3cios na Web.</p><p>Em outras palavras, isso garante que ningu\xe9m possa ver as informa\xe7\xf5es entre as comunica\xe7\xf5es entre cliente e servidor, impossibilitando que qualquer pessoa veja dados essenciais, como n\xfameros de cart\xe3o de cr\xe9dito, IDs, senhas e outros dados pessoais.</p></div>"},"type":"url"}]}]')}}]);